import React from 'react';
import '../css/LogIn.css';
import fbLogo from '../img/fb-logo.png';
import logo from '../img/logo.png';

class LogIn extends React.Component {
    render() {
        return(
            <div className="container">
                <div className="form-container absolute-center form-size">
                </div>
                <div className="form-size absolute-center logo-space disply-in-block">
                    <img src={logo} alt="facebook" className="logo-space logo" />
                    <br /><br />
                    <span className="logo-text">Log in with Facebook</span>
                    <br />
                    <button class="ui facebook button btn-space btn-padding">
                        <i class="facebook icon" />
                        Log in with Facebook
                    </button>        
                </div>
            </div>
        );
    }
}

export default LogIn;
